function ChildComponent(props) {
  return (
    <div>
      <h1>{props.title}</h1>
      {props.children}
      {props.childProps}
    </div>
  );
}

function ChildPropsComponent(props) {
  return (
    <div>
      <h1>{props.title}</h1>
      {props.children}
    </div>
  );
}

class CompositionVsInheritance extends React.Component {
  render() {
    return (
      <ChildComponent
        title="compositionVsInheritance:"
        childProps={ChildPropsComponent}
      >
        <p>Hello I am props.children</p>
      </ChildComponent>
    );
  }
}

export default CompositionVsInheritance;
